import {useState, useEffect} from'react';
import axios from 'axios';
import './App.css';

function App() {
  const [User, setUser] = useState([]);

  useEffect(() => {
    async function getAllUsers() {
      try {
        const User = await axios.get('http://127.0.0.1:8000/api/users/');
        console.log(User.data);
        setUser(User.data);

      } catch (error) {
        console.log(error);
      }
    }
    getAllUsers()
  },[]);


  return (
    <div className="App">
      {
        User.map((User, i)=>{
          return (
            <h2 > {User.username}</h2>
          )
        })


      }
    </div>
  );
}

export default App;
